import React from "react";
import question from "./Api";

let App = () =>{
    return(
        <>
        {question.map((CurValue, Index)=>{
            return(
               <>
               <h2>{CurValue.Ques}</h2>
                <p>{CurValue.Answer}</p>
               </>
            )

        })}
        <h1>Asad Rehman</h1>

        </>
    )

}

export default App;
